import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  divPhone:{
    marginRight:'48px',
    "&:last-child": {
      marginRight: 0,
      marginLeft:"48px",
    },
    width:'50%',
    display:"flex",
    flexDirection:'column',
  },
  text:{
    fontSize:'30px !important',
    height:'130px',
    width:'300px',
    alignSelf:"center"
  }
})
